  StyledContainer,
  Form,
  Img,
  Input,
  RecoveryButton,
  BackToHome
} from './styled'

export default class Header extends Component {
  render() {
    return (
      <StyledContainer>
        <h1>Hi, Hudson!</h1>
        <Img
          src='http://afernandes.adv.br/wp-content/uploads/Team-Member-3.jpg'
          alt='Avatar'
        />
      </StyledContainer>
    )
  }
}
